const React = require('react');
const { FormControl, Button, InputGroup } = require('react-bootstrap');

export class URLShortener extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className={this.props.className}>
        <h2>URL Shortener</h2>
        <p>Here you can enter some long URL-address to get short one.</p>
        <InputGroup>
          <FormControl
            placeholder="http://www.example.com"
          />
          <InputGroup.Append>
            <Button variant="outline-primary">Get short</Button>
          </InputGroup.Append>
        </InputGroup>
      </div>
    )
  }
}
